pragma solidity ^0.8.0;

contract MyContract {

    address public fundswallet;
    string public name;
    uint8 public decimals;
    string public symbol;
    string public version;
    address public contractaddress;
    uint256 public preicosupply;
    uint256 public preicototalsupply;
    uint256 public icosupply;
    uint256 public icototalsupply;
    uint256 public maxsupply;
    uint256 public totalsupply;
    uint256 public unitsoneethcanbuy;
    uint256 public totalethinwei;
    bool public token_was_created;
    bool public createtokensforcrypton;
    uint256 public preicofinishtimestamp;
    uint256 public fundingendtime;
    uint256 public finaltokensissuetime;

    mapping(address => uint256) public balanceof;
    mapping(address => mapping(address => uint256)) public allowance;

    constructor() payable {
        if(msg.value == 0) {
            fundswallet = msg.sender;
            name = '0';
            symbol = '0';
            decimals = 18;
            balanceof[fundswallet] = 0;
            totalsupply = 0;
            preicototalsupply = 0xbe951906eba2aa8000000;
            icototalsupply = 0x1dc74be914d16aa4000000;
            maxsupply = 0x3b8e97d229a2d548000000;
            unitsoneethcanbuy = 377;
            preicofinishtimestamp = 0x5ae26348;
            fundingendtime = 0x5b1c6548;
            finaltokensissuetime = 0x5e0d2dc8;
            contractaddress = address(this);
        }
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    function withdraw() public {
        require(msg.sender == fundswallet);
        payable(fundswallet).transfer(address(this).balance);
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(_value <= balanceof[_from]);
        require(_value <= allowance[_from][msg.sender]);
        balanceof[_from] -= _value;
        balanceof[_to] += _value;
        allowance[_from][msg.sender] -= _value;
        return true;
    }

    function setTokenPrice(uint256 _value) public {
        require(_value < 1500);
        require(msg.sender == fundswallet);
        unitsoneethcanbuy = _value;
    }

    function burn(uint256 _value) public returns (bool success) {
        require(balanceof[msg.sender] >= _value);
        balanceof[msg.sender] -= _value;
        totalsupply -= _value;
        return true;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(balanceof[msg.sender] >= _value);
        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;
        return true;
    }

    fallback() external payable {
        // logic here
    }

    function stopIco() public {
        require(block.timestamp > fundingendtime);
        createtokensforcrypton = true;
    }

    function burnFrom(address _from, uint256 _value) public returns (bool success) {
        require(balanceof[_from] >= _value);
        require(_value <= allowance[_from][msg.sender]);
        balanceof[_from] -= _value;
        allowance[_from][msg.sender] -= _value;
        return true;
    }
}
